# Captures data for a specific page with provided url
def load_urls(pageUrl):

    print("Fetching items...")

    source = requests.get(
        url=pageUrl,
        allow_redirects=True,
        headers={"User-Agent": "PostmanRuntime/7.28.4"},
    )

    soup = bs.BeautifulSoup(source.text, "html.parser")

    items = soup.find_all("div", {"class": "StyledCard-sc-6ce7as-1"})

    for item in items:
        url = item.find("a")["href"]
        with open("./scan-{}-properati-pe.txt".format(date.today()), "a") as scan:
            scan.writelines('"https://www.properati.com.pe{}", \n'.format(str(url)))
            scan.close()


